import Logo from "../components/Logo";

var style = {
  position: "relative",
  bottom: "0",
  width: "100%",
  height: "120px" /* Set the fixed height of the footer here */,
  lineHeight: "60px" /* Vertically center the text there */,
  backgroundColor: "#f5f5f5",
};

const Footer = () => (
  <footer style={style}>
    <div class="container">
      <div class="row">
        <Logo/>
        <Logo/>
        <div class="col-sm">One of three columns</div>
      </div>
    </div>
  </footer>
);

export default Footer;
